package dog;

public class Dog {

    public static String wakeUp(){
       int time = 6;
       String wakeTime = "dog wakes up at: " + time + "AM";
       return wakeTime;
    }

    public static String goToSleep(){
       int time = 8;
       String bedTime = "dog goes to sleep at: " + time + "PM";
       return bedTime;
    }

    public static void main(String[] args){
       System.out.println(wakeUp());
       System.out.println(goToSleep());
    }

}
